function Contact() {
  return (
    <section id="contact" className="py-20 text-center">
      <h2 className="text-3xl font-bold mb-6">Contact Me</h2>
      <p className="mb-6">Email: <a href="mailto:eljadi.souf" className="text-green-500">you@example.com</a></p>
      <p>
        LinkedIn: <a href="https://linkedin.com/in/yourprofile" className="text-green-500" target="_blank">Profile</a>
      </p>
    </section>
  );
}

export default Contact;
